sys_variable_value.value:
(function execute(inputs, outputs) {
    var pubSub = new GooglePubsubUtils();
    pubSub.validateInputVariables(inputs, outputs);
    pubSub.validateMandatoryVariables(inputs, ["projectid", "snapshot", "subscription"]);
    pubSub.maptoOutputFromInput(inputs, outputs, ["projectid", "snapshot"]);
    var payload = {
        "subscription": "projects/"+inputs.projectid+"/subscriptions/"+inputs.subscription
    }
    var labels = pubSub.arrayObjecttoObject(inputs.labels);
    if (labels)
        payload["labels"] = labels;
    outputs.payload = JSON.stringify(payload);
})(inputs, outputs);

